

--
-- Table structure for table `tb_students`
--

CREATE TABLE IF NOT EXISTS `tb_students` (
  `StudentID` varchar(17) COLLATE utf8_unicode_ci NOT NULL COMMENT 'รหัสนักเรียน',
  `StudentNumber` int(2) NOT NULL COMMENT 'เลขที่',
  `StudentClass` varchar(7) COLLATE utf8_unicode_ci NOT NULL COMMENT 'ชั้นปี',
  `StudentCode` varchar(5) COLLATE utf8_unicode_ci NOT NULL COMMENT 'เลขประจำตัว',
  `StudentPrefix` varchar(10) COLLATE utf8_unicode_ci NOT NULL COMMENT 'คำนำหน้า',
  `StudentFirstName` varchar(25) COLLATE utf8_unicode_ci NOT NULL COMMENT 'ชื่อ',
  `StudentLastName` varchar(25) COLLATE utf8_unicode_ci NOT NULL COMMENT 'นามสกุล',
  `StudentIDNumber` varchar(13) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'เลขประจำตัวประชาชน',
  `StudentDateBirth` varchar(10) COLLATE utf8_unicode_ci NOT NULL COMMENT 'วันเกิด',
  `StudentDateEntrance` varchar(10) COLLATE utf8_unicode_ci NOT NULL COMMENT 'วันที่เข้าเรียน',
  `StudentSex` varchar(4) COLLATE utf8_unicode_ci NOT NULL COMMENT 'เพศ',
  `StudentNationality` varchar(25) COLLATE utf8_unicode_ci NOT NULL COMMENT 'สัญชาติ',
  `StudentRace` varchar(25) COLLATE utf8_unicode_ci NOT NULL COMMENT 'เชื้อชาติ',
  `StudentFather` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'ชื่อบิดา',
  `StudentMother` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'ชื่อมารดา',
  `StudentOldSchool` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'โรงเรียนเดิม',
  `StudentProvince` varchar(25) COLLATE utf8_unicode_ci NOT NULL COMMENT 'จังหวัด',
  `StudentPrefecture` varchar(25) COLLATE utf8_unicode_ci NOT NULL COMMENT 'อำเภอ/เขต',
  `StudentDateApprove` varchar(10) COLLATE utf8_unicode_ci NOT NULL COMMENT 'วันอนุมัติ',
  `StudentDateFinish` varchar(10) COLLATE utf8_unicode_ci NOT NULL COMMENT 'วันจบการศึกษา',
  `StudentLeave` varchar(30) COLLATE utf8_unicode_ci NOT NULL COMMENT 'สาเหตุที่ออก',
  `GPASchool` varchar(4) COLLATE utf8_unicode_ci NOT NULL COMMENT 'GPA ของโรงเรียน',
  `YearFinish` varchar(5) COLLATE utf8_unicode_ci NOT NULL,
  `ONET_THA` varchar(5) COLLATE utf8_unicode_ci NOT NULL,
  `ONET_MAT` varchar(5) COLLATE utf8_unicode_ci NOT NULL,
  `ONET_SCI` varchar(5) COLLATE utf8_unicode_ci NOT NULL,
  `ONET_SOC` varchar(5) COLLATE utf8_unicode_ci NOT NULL,
  `ONET_PHY` varchar(5) COLLATE utf8_unicode_ci NOT NULL,
  `ONET_ART` varchar(5) COLLATE utf8_unicode_ci NOT NULL,
  `ONET_TCH` varchar(5) COLLATE utf8_unicode_ci NOT NULL,
  `ONET_ENG` varchar(5) COLLATE utf8_unicode_ci NOT NULL,
  `GPAOnet` varchar(4) COLLATE utf8_unicode_ci NOT NULL COMMENT 'GPA ของ ONET',
  `GPATotal` varchar(4) COLLATE utf8_unicode_ci NOT NULL COMMENT 'รวม GPA',
  `PW1_Series` varchar(10) COLLATE utf8_unicode_ci NOT NULL,
  `PW1_No` varchar(10) COLLATE utf8_unicode_ci NOT NULL,
  `PW2_No` varchar(5) COLLATE utf8_unicode_ci NOT NULL,
  `Evaluate_Basic` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  `Evaluate_More` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  `Evaluate_RAW` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  `Evaluate_Attribute` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  `Evaluate_Develop` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  `Note` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `StudentPlan` varchar(30) COLLATE utf8_unicode_ci NOT NULL,
  `StudentStatus` varchar(25) COLLATE utf8_unicode_ci NOT NULL,
  `StudentRegion` varchar(25) COLLATE utf8_unicode_ci NOT NULL,
  `PrefixFather` varchar(25) COLLATE utf8_unicode_ci NOT NULL,
  `FNameFather` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `LNameFather` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `PrefixMother` varchar(25) COLLATE utf8_unicode_ci NOT NULL,
  `FNameMother` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `LNameMother` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `YearIn` varchar(6) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'ภาคเรียน/ปีการศึกษาที่เข้า',
  `PINFather` varchar(13) COLLATE utf8_unicode_ci NOT NULL,
  `PINMother` varchar(13) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`StudentID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='เก็บข้อมูลนักเรียนเฉพาะที่ใช้ออก ปพ.1';

